pragma solidity >=0.4.21 <0.6.0;

contract Leaderboard {event __CoverageLeaderboard(string fileName, uint256 lineNumber);
event __FunctionCoverageLeaderboard(string fileName, uint256 fnId);
event __StatementCoverageLeaderboard(string fileName, uint256 statementId);
event __BranchCoverageLeaderboard(string fileName, uint256 branchId, uint256 locationIdx);
event __AssertPreCoverageLeaderboard(string fileName, uint256 branchId);
event __AssertPostCoverageLeaderboard(string fileName, uint256 branchId);

    address[] private players;
    mapping (address => uint) public player_ETH;
    address public firstPlacePlayer = address(0);

    function _updateFirstPlace() private{emit __FunctionCoverageLeaderboard('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Leaderboard.sol',1);

emit __CoverageLeaderboard('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Leaderboard.sol',9);
        emit __StatementCoverageLeaderboard('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Leaderboard.sol',1);
for (uint i = 0; i < players.length ; i++) {
emit __CoverageLeaderboard('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Leaderboard.sol',10);
            emit __StatementCoverageLeaderboard('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Leaderboard.sol',2);
address player = players[i];
emit __CoverageLeaderboard('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Leaderboard.sol',11);
            emit __StatementCoverageLeaderboard('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Leaderboard.sol',3);
uint playerWinETH = player_ETH[player];
            // The ETH that you get needs to be greater than the first place player who is in the first time.
emit __CoverageLeaderboard('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Leaderboard.sol',13);
            emit __StatementCoverageLeaderboard('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Leaderboard.sol',4);
if (playerWinETH > player_ETH[firstPlacePlayer]) {emit __BranchCoverageLeaderboard('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Leaderboard.sol',1,0);
emit __CoverageLeaderboard('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Leaderboard.sol',14);
                emit __StatementCoverageLeaderboard('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Leaderboard.sol',5);
firstPlacePlayer = player;
            }else { emit __BranchCoverageLeaderboard('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Leaderboard.sol',1,1);}

        }
    }

    function enterLeaderBoard(address add, uint winAmount) internal {emit __FunctionCoverageLeaderboard('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Leaderboard.sol',2);

emit __CoverageLeaderboard('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Leaderboard.sol',20);
        emit __StatementCoverageLeaderboard('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Leaderboard.sol',6);
if (!_isInLeaderBoard(add)) {emit __BranchCoverageLeaderboard('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Leaderboard.sol',2,0);
emit __CoverageLeaderboard('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Leaderboard.sol',21);
            emit __StatementCoverageLeaderboard('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Leaderboard.sol',7);
players.push(add);
        }else { emit __BranchCoverageLeaderboard('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Leaderboard.sol',2,1);}

emit __CoverageLeaderboard('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Leaderboard.sol',23);
        emit __StatementCoverageLeaderboard('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Leaderboard.sol',8);
player_ETH[add] += winAmount;
emit __CoverageLeaderboard('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Leaderboard.sol',24);
        emit __StatementCoverageLeaderboard('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Leaderboard.sol',9);
_updateFirstPlace();
    }

    function _isInLeaderBoard(address add) private      returns(bool) {emit __FunctionCoverageLeaderboard('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Leaderboard.sol',3);

emit __CoverageLeaderboard('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Leaderboard.sol',28);
        emit __StatementCoverageLeaderboard('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Leaderboard.sol',10);
for (uint i = 0; i < players.length ; i++) {
emit __CoverageLeaderboard('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Leaderboard.sol',29);
            emit __StatementCoverageLeaderboard('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Leaderboard.sol',11);
if (players[i] == add) {emit __BranchCoverageLeaderboard('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Leaderboard.sol',3,0);
emit __CoverageLeaderboard('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Leaderboard.sol',30);
                emit __StatementCoverageLeaderboard('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Leaderboard.sol',12);
return true;
            }else { emit __BranchCoverageLeaderboard('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Leaderboard.sol',3,1);}

        }
emit __CoverageLeaderboard('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Leaderboard.sol',33);
        emit __StatementCoverageLeaderboard('/Users/jerrylee/Documents/JerryLee/blockchain/homework_1014/contracts/Leaderboard.sol',13);
return false;
    }
}
